import React from 'react';
import '../../App.css';
import Cards from '../Cards';
import HeroSection from '../HeroSection';
import ImageSlider from '../ImageSlider';
import { SliderData } from '../SliderData';
import Footer from '../Footer';
import About from '../About';

function Home() {
  return (
    <>
      <HeroSection 
        id="home"
      />
      <About
        id="about"
      />
      <Cards
        id="projects"
      />
      <ImageSlider 
        slides={SliderData}
        id="artwork"
      />;
      <Footer />
    </>
  );
}

export default Home;
